import '../styles/App.scss';
import { useState } from 'react';
import dataClubs from '../data/clubs.json';

function App() {
  //Estados
  const [clubs, setClubs] = useState(dataClubs);
  const renderClubs = () => {
    return clubs.map((club, index) => {
      return (
        <li key={index}>
          <h2>{club.name}</h2>
          <p>Abierto entre semana:</p>
          <p>Abierto fines de semana:</p>
        </li>
      );
    });
  };
  return (
    <div>
      <ul>{renderClubs()}</ul>
    </div>
  );
}

export default App;
